import React, { useEffect, useState, useContext } from "react";
import axios from "axios";
import { useParams, Link } from "react-router-dom";
import { AuthContext } from "../context/AuthContext";

const TasksByCategory = () => {
  const { category } = useParams();
  const { token } = useContext(AuthContext);
  const [tasks, setTasks] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    axios
      .get(`http://localhost:8000/tasks/category/${category}`, {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => setTasks(res.data))
      .catch(() => setError("Failed to load tasks by category"));
  }, [category, token]);

  if (error) return <p style={{ color: "red" }}>{error}</p>;
  if (tasks.length === 0) return <p>No tasks found in category: {category}</p>;

  return (
    <div>
      <h2>Tasks in Category: {category}</h2>
      <ul>
        {tasks.map((task) => (
          <li key={task.id}>
            <Link to={`/tasks/edit/${task.id}`}>{task.title}</Link> - Status:{" "}
            {task.status ? "Completed" : "Pending"}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TasksByCategory;
